import React from 'react';


class App extends React.Component{

    constructor(props){
        super(props)

        this.state = {
            users: []
        }
    }
    
    componentDidMount(){
        fetch('https://dummyjson.com/users')
        .then(res => res.json)
        .then(
            (result) => {
                this.state({
                    users: result.users
                })
            }
        )
    }

    render(){
        const users = this.state.users

        return(
            <div>
                <ul>
                    {users.map(user => (
                        <li key={user.name}>
                            {user.firstName}
                        </li>
                    ))}
                </ul>
            </div>
        )
    }
}

export default App
